import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
  avatarIncome: {
    backgroundColor: "rgba(75, 192, 192, 0.5)",
  },
  avatarExpense: {
    backgroundColor: red[500],
  },
  avatarSaving: {
    backgroundColor: blue[500],
  },
}));
